import React, { Component } from 'react';
import {Radio, Pane} from 'evergreen-ui';

class Origin extends Component {
  constructor(props) {
    super(props);

    this.state = {
      origin: "bottom_left",
    }
  }

  render() {
    return (
      <div>
        <Pane aria-label="Radio Group Label 12" role="group">
          <Radio checked name="group" label="Radio default" />
          <Radio name="group" checked label="Radio checked" />
          <Radio name="group" checked label="Radio disabled" />
          <Radio name="group" checked label="Radio checked disabled" />
        </Pane>

      </div>
    );
  }
}

export {Origin};
